			if (usersRes.error || rolesRes.error) {
				setErrorMessage(usersRes.error || rolesRes.error);
				return;
			}

			setUsers(usersRes.res);
			setRoles(rolesRes.res);
		});
	}, [requestServer, shouldUpdateUsersList]);

	return (
		<div>
			<div>Главная</div>
		</div>
	);
};

export const Main = styled(MainContainer)``;
